import React from "react";

const NoteForm = (props) => {
    const {togglePopup, formTitle, userName, firstName, lastName, status, titleChanged, contentChanged, submitClicked, submitText} = props;

    return (
      <form className="popup">
        <div className="popup_inner">
        <button onClick={togglePopup} className="close" >X</button> 
        <h2>{formTitle}</h2>
        <div className="grid">
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="userName"
            value={userName}
            onChange={titleChanged}
          />
<input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="firstName"
            value={firstName}
            onChange={contentChanged}
          />
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="lastName"
            value={lastName}
            onChange={titleChanged}
          />
          <input
            type="text"
            name="title"
            className="form-input mb-30"
            placeholder="status"
            value={status}
            onChange={titleChanged}
          />
  

          <a href="#" className="add-button" onClick={submitClicked}>
            {submitText}
          </a>
        </div>
      </div>
      </form>
    )
}

export default NoteForm
